import styled from 'styled-components/macro'

export const HeaderWrapper = styled.div`
    background:red;
    width:100%;
`

export const Logo = styled.a`
   color:#fff;
   font-size:1.2em;
   text-decoration: none;
   &:hover{
        text-decoration: none;
       color:#fff;
   }
   @media(min-width:576px){
       float:left;
   }
`
